Color in alcohol. Body pallid, lateral silver stripe along the midline overlaying a dark stripe, fading anteriorly, dark stripe narrowing in advance of first dorsal fin as it approaches pectoral fin. (
Fig. 3
). Scales above lateral stripe outlined in melanophores, dorsum with black stripe along middle. Scales below lateral stripe faintly pigmented in some individuals. Venter with black stripe originating posterior to anus and terminating at origin of caudal fin. Distal one-third of first dorsal fin with melanophores on membranes forming black band in males, but not as pronounced in females. Head covered in melanophores, with occiput densely pigmented, chin darkly pigmented, dark spot on lower jaw at rear margin of mouth. Iris silver, dusky dorsally in some individuals, inside of mouth with scattered melanophores along margin and on outside of cheeks. Spines and rays outlined in melanophores, except in pelvic fin, which is devoid of pigment.

Etymology. Likely, from the latin sicula meaning small dagger (
Scharpf & Lazara 2014
).
